function toHex(RGB){
	var thremainder = (RGB)%16;
	var thsecondDigit = (thremainder).toString();
	if (thsecondDigit == '-1'){
		thsecondDigit = '0'
	}
	switch (thsecondDigit){case '10':thsecondDigit = 'a';break;case '11':thsecondDigit = 'b';break;case '12':thsecondDigit = 'c';break;case '13':thsecondDigit = 'd';break;case '14':thsecondDigit = 'e';break;case '15':thsecondDigit = 'f';break;}
	var thfirstDigit = ((parseInt((RGB+1)/16))-1).toString();
	if (thfirstDigit == '-1'){
		thfirstDigit = '0'
	}
	switch (thfirstDigit){case '10':thfirstDigit = 'a';break;case '11':thfirstDigit = 'b';break;case '12':thfirstDigit = 'c';break;case '13':thfirstDigit = 'd';break;case '14':thfirstDigit = 'e';break;case '15':thfirstDigit = 'f';break;}
	var toHexOutput = thfirstDigit+thsecondDigit;
	return toHexOutput;
}
function toRGB(Hex){
	var HexArray = Hex.match(/.{1,2}/g)
	var HexR = HexArray[0];
	HexR = HexR.split('');
	var HexG = HexArray[1];
	HexG = HexG.split('');
	var HexB = HexArray[2];
	HexB = HexB.split('');
	HexArray = [HexR,HexG,HexB];
	var i = 0;
	while (i < HexArray.length){
		var ii = 0;
		while (ii < HexArray[i].length){
			switch (HexArray[i][ii]){
				case 'a': HexArray[i][ii] ='10'; break;
				case 'A': HexArray[i][ii] ='10'; break;
				case 'b': HexArray[i][ii] ='11'; break;
				case 'B': HexArray[i][ii] ='11'; break;
				case 'c': HexArray[i][ii] ='12'; break;
				case 'C': HexArray[i][ii] ='12'; break;
				case 'd': HexArray[i][ii] ='13'; break;
				case 'D': HexArray[i][ii] ='13'; break;
				case 'e': HexArray[i][ii] ='14'; break;
				case 'E': HexArray[i][ii] ='14'; break;
				case 'f': HexArray[i][ii] ='15'; break;
				case 'F': HexArray[i][ii] ='15'; break;
			}
			ii++;
		}
		i++;
	}
	var i = 0;
	while (i < HexArray.length){
		var thisHexArray = HexArray[i];
		var thisHexFirst = parseInt(HexArray[i][0]);
		var thisHexSecond = parseInt(HexArray[i][1]);
		thisHexFirst++;
		thisHexSecond++;
		thisHexFirst = thisHexFirst*16;
		HexArray[i] = thisHexFirst+thisHexSecond;
	}
	return HexArray;
}
